&quot;Sophia On The Verge&quot; 



Sophia Bella



MP4 only.



Sophia's time to be tickled has come. She's an easy target it appears. overtly sensitive to even the implication of being tickled. Once actual tickling takes place and Bane works on her feet, Sophia begins to squirm. The squirming really begins when he reaches her upper torso and Sophia screams red. There's no red in tickling! And Bane carries onward, despite her panicked protests, which lead to a tag team of tickling..



